script: |
  super -f text -I q9546.spq | sort > q9546.out

inputs:
  - name: q9546.spq
    data: |
      SELECT DISTINCT - + 50 AS col0, ( - + col0 ) / - - col1 - + ( 99 ) * - col2 * - + ( + col2 ) * - - col2 FROM tab1 (FORMAT parquet) WHERE NOT + 75 BETWEEN - ( col0 ) AND NULL;
  - name: tab1

outputs:
  - name: q9546.out
    data: |
